import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.button`
  border: solid 1px;
  padding: 10px;
  font-family: Roboto;
  font-style: normal;
  font-weight: normal;
  font-size: 20px;
  line-height: 23px;
  letter-spacing: -0.015em;

  .boardFilterIcon {
    width: 24px;
    height: 24px;
  }

  .boardFilterName {
    margin-left: 25px;
  }

  .boardDownButton {
    width: 15px;
    height: 8px;
    cursor: pointer;
  }
  .
`;

const GatherFilter = (props) => {
  return <>
  <Wrapper>
    <img src="assets/images/boardFilterIcon.png" alt="icon" className="boardFilterIcon" />
    <span className="boardFilterName">최신순</span>
    <img src="assets/images/boardDownButton.png" alt="button" className="boardDownButton" />
  </Wrapper>
  </>;
}

export default GatherFilter;
